import React from 'react'

function Post() {
  return (
    <div className='Post overflow-x-scroll'>
      <div className="postHeader">
        <img src="/assets/person/1.jpeg" alt="" className="topbarImg cursor-pointer h-10 w-10 rounded-full object-cover -mr-20"/>

      </div>
    </div>
  )
}

export default Post
